# List to store dictionaries of album information

# Assuming you already have the soup object
center_content = soup.find(id="centerContent")

# Find all children with class name "albumListRow"
album_list_rows = center_content.find_all(class_="albumListRow")
albums_info = []

# Iterate through each album row
for row in album_list_rows:
    # Extract album information
    title = row.find("a").text.strip()
    cover_img = row.find("img")
    cover_url = cover_img.get("data-src") if cover_img else None
    date = row.find(class_="albumListDate").text.strip()
    genres = [genre.text.strip() for genre in row.find_all(class_="albumListGenre")[0].find_all("a")]
    critic_score = row.find(class_="scoreValue").text.strip()
    num_reviews = row.find(class_="scoreText").text.strip().split()[0]

    # Store album information in a dictionary
    album_info = {
        "title": title,
        "cover_url": cover_url,
        "date": date,
        "genres": genres,
        "critic_score": critic_score,
        "num_reviews": num_reviews
    }

    # Add album dictionary to the list
    albums_info.append(album_info)

# Iterate through each album dictionary
for index, album in enumerate(albums_info, start=1):
    try:
        # Extract the filename from the URL
        url = album['cover_url']
        filename = url.split('/')[-1]  # Naming the image based on its order
    
        # Send a GET request to the URL
        response = requests.get(url)
        
        # Check if the request was successful (status code 200)
        if response.status_code == 200:
            # Open a file in binary write mode to save the image inside the 'images' folder
            with open(os.path.join('images', filename), "wb") as f:
                # Write the content of the response (image data) to the file
                f.write(response.content)
            album['cover_url'] = filename
            print(f"Image '{filename}' downloaded successfully!")
        else:
            print(f"Failed to download image '{filename}':", response.status_code)
    except Exception as e:
        print(f"Error downloading image for album {album['title']}: {str(e)}")
